import React from "react";
import {NavLink } from "react-router-dom";
function Menu() {
    return (
        <>
        <div className="top-menu">
        <ul className="topBar ml-auto d-flex ml-auto">
         <li>
         <a href="tel:8884949460" className="icon-link"><span>Toll-Free 888.494.9460 </span></a>
       </li>
       <li>
         <a className="login" data-toggle="modal" data-target="#portal_login">login</a>
       </li>
       </ul>
     </div>
      <div>
        <NavLink exact activeClassName="active" to="/">Home</NavLink>
        <NavLink exact activeClassName="active"  to="/contact">Contact Us </NavLink>
      </div>
      </>
    );
  };
export default Menu;
